import React, { useState, useEffect } from 'react';

import Teamimages from '../Utilities/ImageDirectories/16TeamsPhotos.json'

function App() {
  const [loaded, setLoaded] = useState(false);

  useEffect(() => {
    setLoaded(true);
  }, []);

  return (
    <div className="h-screen w-screen">
      <div className="h-screen w-full flex justify-center items-center">
        <img
          src="images/Carousel_Images/16_team_photos/PXP-9969.jpg"
          alt="Large Photo"
          className={`${
            loaded ? 'opacity-100' : 'opacity-0'
          } transition-opacity duration-1000 h-screen`}
          style={{
            width: '100%',
            height: '100%',
            objectFit: 'cover',
          }}
        />
      </div>
      <div className="h-1/2 w-full p-4 grid grid-cols-2 gap-4">
        {Teamimages.map((image, index) => (
          <img
            key={index}
            src={image.url}
            alt={image.alt}
            className="w-full h-full object-cover"
          />
        ))}
      </div>
    </div>
  );
}

export default App;
